function mostrarClubParticipante(club, indice) {
    if (indice % 2 === 0){
        return(
            <tr class="fpar">
                <td>{club.nombre}</td>
                <td><button onClick={() => sacarClubParticipante(indice, club)}>Sacar</button></td>
            </tr>
        )
    }
    else {
        return(
            <tr class="fimpar">
                <td>{club.nombre}</td>
                <td><button onClick={() => sacarClubParticipante(indice, club)}>Sacar</button></td>
            </tr>
        )
    }
}

export default mostrarClubParticipante;
